// AUDIO SYSTEM
const AudioCtx = window.AudioContext || window.webkitAudioContext;
let audioCtx = null;
let trumpSound = null; // Will hold the uploaded Trump audio
let musicPlaying = false;

// Hail to the Chief MP3 (base64 encoded)
const MUSIC_DATA = '';

let musicGain = null;

const SOUND_BYTES = [
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  "",
  ""
];

// Sound byte system - plays random clips throughout gameplay
let soundByteBuffers = [];
let soundBytesLoaded = false;
let lastSoundByteTime = 0;
const SOUND_BYTE_MIN_INTERVAL = 12000; // Minimum 12 seconds between sound bytes
const SOUND_BYTE_MAX_INTERVAL = 18000; // Maximum 18 seconds
let nextSoundByteTime = 0;

async function loadSoundBytes() {
  if (soundBytesLoaded || !audioCtx) return;
  for (let i = 0; i < SOUND_BYTES.length; i++) {
    try {
      const binary = atob(SOUND_BYTES[i]);
      const bytes = new Uint8Array(binary.length);
      for (let j = 0; j < binary.length; j++) bytes[j] = binary.charCodeAt(j);
      const buffer = await audioCtx.decodeAudioData(bytes.buffer.slice(0));
      soundByteBuffers.push(buffer);
    } catch(e) { console.log('Failed to load sound byte', i, e); }
  }
  soundBytesLoaded = true;
  nextSoundByteTime = Date.now() + SOUND_BYTE_MIN_INTERVAL + Math.random() * (SOUND_BYTE_MAX_INTERVAL - SOUND_BYTE_MIN_INTERVAL);
  console.log('Loaded', soundByteBuffers.length, 'sound bytes');
}

function playRandomSoundByte() {
  if (!soundBytesLoaded || soundByteBuffers.length === 0 || !audioCtx) return;
  const idx = Math.floor(Math.random() * soundByteBuffers.length);
  const source = audioCtx.createBufferSource();
  source.buffer = soundByteBuffers[idx];
  const gain = audioCtx.createGain();
  gain.gain.value = 0.6;
  source.connect(gain);
  gain.connect(audioCtx.destination);
  source.start(0);
}

function checkSoundByte() {
  if (!soundBytesLoaded) return;
  const now = Date.now();
  if (now >= nextSoundByteTime) {
    playRandomSoundByte();
    nextSoundByteTime = now + SOUND_BYTE_MIN_INTERVAL + Math.random() * (SOUND_BYTE_MAX_INTERVAL - SOUND_BYTE_MIN_INTERVAL);
  }
}


function initAudio() {
  if (!audioCtx) audioCtx = new AudioCtx();
  if (audioCtx.state === 'suspended') audioCtx.resume();
  loadSoundBytes();
}

// Music player using HTML5 Audio for the MP3
let bgMusic = null;

function playMusic() {
  if (musicPlaying) return;
  musicPlaying = true;
  
  if (!bgMusic) {
    bgMusic = new Audio('data:audio/mp3;base64,' + MUSIC_DATA);
    bgMusic.loop = true;
    bgMusic.volume = 0.35;
  }
  bgMusic.currentTime = 0;
  bgMusic.play().catch(e => console.log('Music autoplay blocked'));
}

function stopMusic() {
  musicPlaying = false;
  if (bgMusic) {
    bgMusic.pause();
  }
}

function setMusicVolume(vol) {
  if (bgMusic) bgMusic.volume = vol;
}

// Synthesized sound effects
function playSound(type) {
  if (!audioCtx) return;
  const now = audioCtx.currentTime;
  
  switch(type) {
    case 'punch': {
      // Punchy impact sound
      const osc = audioCtx.createOscillator();
      const gain = audioCtx.createGain();
      osc.type = 'square';
      osc.frequency.setValueAtTime(150, now);
      osc.frequency.exponentialRampToValueAtTime(50, now + 0.1);
      gain.gain.setValueAtTime(0.3, now);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.1);
      osc.connect(gain);
      gain.connect(audioCtx.destination);
      osc.start(now);
      osc.stop(now + 0.1);
      // Add noise burst
      const noise = audioCtx.createBufferSource();
      const noiseBuffer = audioCtx.createBuffer(1, audioCtx.sampleRate * 0.05, audioCtx.sampleRate);
      const data = noiseBuffer.getChannelData(0);
      for (let i = 0; i < data.length; i++) data[i] = Math.random() * 2 - 1;
      noise.buffer = noiseBuffer;
      const noiseGain = audioCtx.createGain();
      noiseGain.gain.setValueAtTime(0.2, now);
      noiseGain.gain.exponentialRampToValueAtTime(0.01, now + 0.05);
      noise.connect(noiseGain);
      noiseGain.connect(audioCtx.destination);
      noise.start(now);
      break;
    }
    case 'superPunch': {
      // Big impact
      const osc = audioCtx.createOscillator();
      const gain = audioCtx.createGain();
      osc.type = 'sawtooth';
      osc.frequency.setValueAtTime(200, now);
      osc.frequency.exponentialRampToValueAtTime(30, now + 0.2);
      gain.gain.setValueAtTime(0.4, now);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.2);
      osc.connect(gain);
      gain.connect(audioCtx.destination);
      osc.start(now);
      osc.stop(now + 0.2);
      break;
    }
    case 'destroy': {
      // Explosion/destruction
      const noise = audioCtx.createBufferSource();
      const noiseBuffer = audioCtx.createBuffer(1, audioCtx.sampleRate * 0.3, audioCtx.sampleRate);
      const data = noiseBuffer.getChannelData(0);
      for (let i = 0; i < data.length; i++) data[i] = Math.random() * 2 - 1;
      noise.buffer = noiseBuffer;
      const filter = audioCtx.createBiquadFilter();
      filter.type = 'lowpass';
      filter.frequency.setValueAtTime(1000, now);
      filter.frequency.exponentialRampToValueAtTime(100, now + 0.3);
      const gain = audioCtx.createGain();
      gain.gain.setValueAtTime(0.3, now);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.3);
      noise.connect(filter);
      filter.connect(gain);
      gain.connect(audioCtx.destination);
      noise.start(now);
      break;
    }
    case 'tweet': {
      // Bird-like chirp
      const osc = audioCtx.createOscillator();
      const gain = audioCtx.createGain();
      osc.type = 'sine';
      osc.frequency.setValueAtTime(800, now);
      osc.frequency.setValueAtTime(1200, now + 0.05);
      osc.frequency.setValueAtTime(1000, now + 0.1);
      gain.gain.setValueAtTime(0.15, now);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.15);
      osc.connect(gain);
      gain.connect(audioCtx.destination);
      osc.start(now);
      osc.stop(now + 0.15);
      break;
    }
    case 'golf': {
      // Golf club whoosh + hit
      const osc = audioCtx.createOscillator();
      const gain = audioCtx.createGain();
      osc.type = 'sine';
      osc.frequency.setValueAtTime(300, now);
      osc.frequency.exponentialRampToValueAtTime(800, now + 0.1);
      osc.frequency.exponentialRampToValueAtTime(100, now + 0.15);
      gain.gain.setValueAtTime(0.01, now);
      gain.gain.linearRampToValueAtTime(0.2, now + 0.08);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.15);
      osc.connect(gain);
      gain.connect(audioCtx.destination);
      osc.start(now);
      osc.stop(now + 0.15);
      break;
    }
    case 'jump': {
      // Boing
      const osc = audioCtx.createOscillator();
      const gain = audioCtx.createGain();
      osc.type = 'sine';
      osc.frequency.setValueAtTime(200, now);
      osc.frequency.exponentialRampToValueAtTime(600, now + 0.1);
      gain.gain.setValueAtTime(0.15, now);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.1);
      osc.connect(gain);
      gain.connect(audioCtx.destination);
      osc.start(now);
      osc.stop(now + 0.1);
      break;
    }
    case 'dash': {
      // Whoosh
      const noise = audioCtx.createBufferSource();
      const noiseBuffer = audioCtx.createBuffer(1, audioCtx.sampleRate * 0.15, audioCtx.sampleRate);
      const data = noiseBuffer.getChannelData(0);
      for (let i = 0; i < data.length; i++) data[i] = Math.random() * 2 - 1;
      noise.buffer = noiseBuffer;
      const filter = audioCtx.createBiquadFilter();
      filter.type = 'bandpass';
      filter.frequency.setValueAtTime(500, now);
      filter.frequency.exponentialRampToValueAtTime(2000, now + 0.15);
      const gain = audioCtx.createGain();
      gain.gain.setValueAtTime(0.01, now);
      gain.gain.linearRampToValueAtTime(0.15, now + 0.05);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.15);
      noise.connect(filter);
      filter.connect(gain);
      gain.connect(audioCtx.destination);
      noise.start(now);
      break;
    }
    case 'powerup': {
      // Ascending arpeggio
      [0, 0.08, 0.16, 0.24].forEach((t, i) => {
        const osc = audioCtx.createOscillator();
        const gain = audioCtx.createGain();
        osc.type = 'square';
        osc.frequency.setValueAtTime([262, 330, 392, 523][i], now + t);
        gain.gain.setValueAtTime(0.1, now + t);
        gain.gain.exponentialRampToValueAtTime(0.01, now + t + 0.1);
        osc.connect(gain);
        gain.connect(audioCtx.destination);
        osc.start(now + t);
        osc.stop(now + t + 0.1);
      });
      break;
    }
    case 'hurt': {
      // Descending buzz
      const osc = audioCtx.createOscillator();
      const gain = audioCtx.createGain();
      osc.type = 'sawtooth';
      osc.frequency.setValueAtTime(400, now);
      osc.frequency.exponentialRampToValueAtTime(100, now + 0.3);
      gain.gain.setValueAtTime(0.2, now);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.3);
      osc.connect(gain);
      gain.connect(audioCtx.destination);
      osc.start(now);
      osc.stop(now + 0.3);
      break;
    }
    case 'rage': {
      // Power up roar
      const noise = audioCtx.createBufferSource();
      const noiseBuffer = audioCtx.createBuffer(1, audioCtx.sampleRate * 0.5, audioCtx.sampleRate);
      const data = noiseBuffer.getChannelData(0);
      for (let i = 0; i < data.length; i++) data[i] = Math.random() * 2 - 1;
      noise.buffer = noiseBuffer;
      const filter = audioCtx.createBiquadFilter();
      filter.type = 'lowpass';
      filter.frequency.setValueAtTime(200, now);
      filter.frequency.linearRampToValueAtTime(800, now + 0.2);
      filter.frequency.linearRampToValueAtTime(300, now + 0.5);
      const gain = audioCtx.createGain();
      gain.gain.setValueAtTime(0.01, now);
      gain.gain.linearRampToValueAtTime(0.35, now + 0.15);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.5);
      noise.connect(filter);
      filter.connect(gain);
      gain.connect(audioCtx.destination);
      noise.start(now);
      break;
    }
    case 'combo': {
      // Quick double beep
      [0, 0.06].forEach((t, i) => {
        const osc = audioCtx.createOscillator();
        const gain = audioCtx.createGain();
        osc.type = 'square';
        osc.frequency.setValueAtTime(i === 0 ? 880 : 1100, now + t);
        gain.gain.setValueAtTime(0.08, now + t);
        gain.gain.exponentialRampToValueAtTime(0.01, now + t + 0.05);
        osc.connect(gain);
        gain.connect(audioCtx.destination);
        osc.start(now + t);
        osc.stop(now + t + 0.05);
      });
      break;
    }
    case 'ko': {
      // Enemy KO
      const osc = audioCtx.createOscillator();
      const gain = audioCtx.createGain();
      osc.type = 'square';
      osc.frequency.setValueAtTime(600, now);
      osc.frequency.exponentialRampToValueAtTime(50, now + 0.4);
      gain.gain.setValueAtTime(0.2, now);
      gain.gain.exponentialRampToValueAtTime(0.01, now + 0.4);
      osc.connect(gain);
      gain.connect(audioCtx.destination);
      osc.start(now);
      osc.stop(now + 0.4);
      break;
    }
    case 'trump': {
      // Play uploaded Trump sound if available
      if (trumpSound) {
        const source = audioCtx.createBufferSource();
        source.buffer = trumpSound;
        source.connect(audioCtx.destination);
        source.start(now);
      }
      break;
    }
  }
}

// Load Trump audio clip when uploaded
function loadTrumpAudio(arrayBuffer) {
  if (!audioCtx) initAudio();
  audioCtx.decodeAudioData(arrayBuffer, buffer => {
    trumpSound = buffer;
    console.log('Trump audio loaded!');
  });
}
